(window["webpackJsonp"]=window["webpackJsonp"]||[]).push([["chunk-2d22255a"],{cdbe:function(e){e.exports=JSON.parse('{"name":"Search","description":"In computer science, a search algorithm is any algorithm which solves the search problem, namely, to retrieve information stored within some data structure, or calculated in the search space of a problem domain, either with discrete or continuous values. Typical search algorithms include DFS, BFS, A*, IDA*, dancing links.","items":[{"tags":[{"name":"bfs","url":"/tags/bfs"}],"title":"HDU-1043 Eight","excerpt":"The 15-puzzle has been around for over 100 years; even if you don\'t know it by that name, you\'ve seen it. It is constructed with 15 sliding  tiles, each with a number from 1 to 15 on it, and all packed into a 4 by 4 frame with one tile missing. Let\'s call the missing tile \'x\'; the  object of the puzzle is to arrange the tiles so that they are ordered  as:","updated_at":"2020-10-17T12:00:02+08:00","created_at":"2020-10-17T12:00:02+08:00","url":"/docs/acm/search/hdu-1043"},{"tags":[{"name":"dfs","url":"/tags/dfs"}],"title":"洛谷P1120 小木棍","excerpt":"乔治有一些同样长的小木棍，他把这些木棍随意砍成几段，使得每段的长都不超过50。现在，他想把小木棍拼接成原来的样子，但是却忘记了自己开始时有多少根木棍和它们的长度。给出每段小木棍的长度，编程帮他找出原始木棍的最小可能长度。","updated_at":"2020-10-17T12:00:02+08:00","created_at":"2020-10-17T12:00:02+08:00","url":"/docs/acm/search/luogu-1120"},{"tags":[{"name":"bfs","url":"/tags/bfs"},{"name":"dp","url":"/tags/dp"}],"title":"洛谷P2901 Cow Jogging G","excerpt":"贝西终于尝到了懒惰的后果，决定每周从谷仓到池塘慢跑几次来健身。当然，她不想跑得太累，所以她只打算从谷仓慢跑下山到池塘，然后悠闲地散步回谷仓。","updated_at":"2020-10-17T12:00:02+08:00","created_at":"2020-10-17T12:00:02+08:00","url":"/docs/acm/search/luogu-2901"},{"tags":[{"name":"dfs","url":"/tags/dfs"}],"title":"洛谷P5194 [USACO05DEC] Scales S","excerpt":"约翰有一架用来称牛的体重的天平。与之配套的是 $N$ ( $1 \\\\leq N \\\\leq 1000$ )个已知质量的砝码（所有砝码质量的数值都在32位带符号整数范围内）。","updated_at":"2020-10-17T12:00:02+08:00","created_at":"2020-10-17T12:00:02+08:00","url":"/docs/acm/search/luogu-5194"},{"tags":[{"name":"dfs","url":"/tags/dfs"},{"name":"dp","url":"/tags/dp"}],"title":"洛谷P3052 [USACO12MAR] Cows in a Skyscraper G","excerpt":"A little known fact about Bessie and friends is that they love stair climbing races. A better known fact is that cows really don\'t like going down stairs. So after the cows finish racing to the top of their favorite skyscraper, they had a problem. Refusing to climb back down using the stairs, the cows are forced to use the elevator in order to get back to the ground floor.","updated_at":"2020-10-17T12:00:02+08:00","created_at":"2020-10-17T12:00:02+08:00","url":"/docs/acm/search/luogu-3052"},{"tags":[{"name":"bfs","url":"/tags/bfs"},{"name":"tricks","url":"/tags/tricks"}],"title":"HDU-3567 Eight II","excerpt":"Eight-puzzle, which is also called \\"Nine grids\\", comes from an old game.","updated_at":"2020-10-17T12:00:02+08:00","created_at":"2020-10-17T12:00:02+08:00","url":"/docs/acm/search/hdu-3567"}],"url":"/categories/search"}')}}]);
